actionConfiguration.body:
(username, password) => {
  storeValue("userdata", {
    "username": username,
    "password": password
  });
  let response = getLoginToken.data;
  if (response.hasOwnProperty('access')) {
    showAlert("ENTROU");
    return response;
  } else {
    return {};
  }
}

